a> \u043c\u0430\u043b\u043e\u043b\u0435\u0442\u043d\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B4%D1%83%D0%B0%D1%80%D0%B4_III\" title=\"\u042d\u0434\u0443\u0430\u0440\u0434 III\">\u042d\u0434\u0443\u0430\u0440\u0434 III<\/a>. \u0420\u0435\u0430\u043b\u044c\u043d\u0430\u044f \u0432\u043b\u0430\u0441\u0442\u044c \u0441\u043e\u0441\u0440\u0435\u0434\u043e\u0442\u043e\u0447\u0438\u043b\u0430\u0441\u044c \u0432 \u0440\u0443\u043a\u0430\u0445 \u043c\u0430\u0442\u0435\u0440\u0438 \u042d\u0434\u0443\u0430\u0440\u0434\u0430, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B7%D0%B0%D0%B1%D0%B5%D0%BB%D0%BB%D0%B0_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%B0%D1%8F\" title=\"\u0418\u0437\u0430\u0431\u0435\u043b\u043b\u0430 \u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f\">\u0418\u0437\u0430\u0431\u0435\u043b\u043b\u044b \u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439<\/a>, \u0438 \u0435\u0451 \u043b\u044e\u0431\u043e\u0432\u043d\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%80%D1%82%D0%B8%D0%BC%D0%B5%D1%80,_%D0%A0%D0%BE%D0%B4%D0%B6%D0%B5%D1%80,_1-%D0%B9_%D0%B3%D1%80%D0%B0%D1%84_%D0%9C%D0%B0%D1%80%D1%87\" title=\"\u041c\u043e\u0440\u0442\u0438\u043c\u0435\u0440, \u0420\u043e\u0434\u0436\u0435\u0440, 1-\u0439 \u0433\u0440\u0430\u0444 \u041c\u0430\u0440\u0447\">\u0420\u043e\u0434\u0436\u0435\u0440\u0430 \u041c\u043e\u0440\u0442\u0438\u043c\u0435\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1411\" class=\"mw-redirect\" title=\"1411\">1411<\/a>&#160;\u2014 \u0417\u0430\u043a\u043b\u044e\u0447\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D1%8B%D0%B9_%D0%A2%D0%BE%D1%80%D1%83%D0%BD%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80\" title=\"\u041f\u0435\u0440\u0432\u044b\u0439 \u0422\u043e\u0440\u0443\u043d\u044c\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\">\u041f\u0435\u0440\u0432\u044b\u0439 \u0422\u043e\u0440\u0