.wikipedia.org\/wiki\/1409\" class=\"mw-redirect\" title=\"1409\">1409<\/a>\u2014<a href=\"https:\/\/ru.wikipedia.org\/wiki\/1411_%D0%B3%D0%BE%D0%B4\" title=\"1411 \u0433\u043e\u0434\">1411 \u0433\u043e\u0434\u043e\u0432<\/a>, \u043f\u0440\u0438\u0432\u0435\u0434\u0448\u0443\u044e \u043a \u0440\u0430\u0437\u0433\u0440\u043e\u043c\u0443 \u0432\u043e\u0439\u0441\u043a \u041e\u0440\u0434\u0435\u043d\u0430 \u0441\u043e\u044e\u0437\u043d\u044b\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D1%8E%D0%BD%D0%B2%D0%B0%D0%BB%D1%8C%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D0%B8%D1%82%D0%B2%D0%B0\" title=\"\u0413\u0440\u044e\u043d\u0432\u0430\u043b\u044c\u0434\u0441\u043a\u0430\u044f \u0431\u0438\u0442\u0432\u0430\">\u0413\u0440\u044e\u043d\u0432\u0430\u043b\u044c\u0434\u0441\u043a\u043e\u0439 \u0431\u0438\u0442\u0432\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1410_%D0%B3%D0%BE%D0%B4\" title=\"1410 \u0433\u043e\u0434\">1410 \u0433\u043e\u0434\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1587\" class=\"mw-redirect\" title=\"1587\">1587<\/a>&#160;\u2014 \u041f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0435 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0439 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D0%B8%D0%B7%D0%B0%D0%B2%D0%B5%D1%82%D0%B0_I\" title=\"\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0430 I\">\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u043e\u0439 I<\/a> \u0441\u043c\u0435\u0440\u0442\u043d\u043e\u0433\u043e \u043f\u0440\u0438\u0433\u043e\u0432\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B8%D1%8F_%D0%A1%D1%82%D1%8E%D0%B0%D1%80%D1%82\" title=\"\u041c\u0430\u0440\u0438\u044f \u0421\u0442\u044e\u0430\u0440\u0442\">\u041c\u0430\u0440\u0438\u0438 \u0421\u0442\u044e\u0430\u0440\u0442<\/a><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1597\" class=\"mw-redirect\" title=\"1597\">1597<\/a>&#160;\u2014 \u0423\u043a\u0430\u0437\u044b \u043e\u0431 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D1%80%D0%BE%D1%87%D0%BD%D1%8B%D0%B5_%D0%BB%D0%B5%D1%82%D0%B0\" title=\"\u0423\u0440\u043e\u0447\u043d\u044b\u0435 \u043b\u0435\u0442\u0430\">\u0443\u0440\u043e\u0447\u043d\u044b\u0445 \u043b\u0435\u0442\u0430\u0445<\/a>\u00bb, \u043e \u043a\u0430\u0431\u0430\u043b\u044c\u043d\u044b\u0445 \u0445\u043e\u043b\u043e\u043f\u0430\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1662\" class=\"mw-redirect\" title=\"1662\">1662<\/a>&#160;\u2014 \u041a\u0438\u0442\u0430\u0439\u0441\u043a\u0438\u0439 \u0433\u0435\u043d\u0435\u0440\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B6%D1%8D%D0%BD_%D0%A7%D1%8D%D0%BD%D0%B3%D1%83%D0%BD\" title=\"\u0427\u0436\u044d\u043d \u0427\u044d\u043d\u0433\u0443\u043d\">\u0427\u0436\u044d\u043d \u0427\u044d\u043d\u0433\u0443\u043d<\/a>, \u0432\u0437\u044f\u0432 \u043f\u043e\u0441\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%B0%D0%B4%D0%B0_%D1%84%D0%BE%D1%80%D1%82%D0%B0_%D0%97%D0%B5%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u041e\u0441\u0430\u0434\u0430 \u0444\u043e\u0440\u0442\u0430 \u0417\u0435\u043b\u0430\u043d\u0434\u0438\u044f\">\u0434\u0435\u0432\u044f\u0442\u0438\u043c\u0435\u0441\u044f\u0447\u043d\u043e\u0439 \u043e\u0441\u0430\u0434\u044b<\/a> \u0444\u043e\u0440\u0442 \u00ab\u0417\u0435\u043b\u0430\u043d\u0434\u0438\u044f\u00bb, \u0438\u0437\u0433\u043d\u0430\u043b \u0433\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0438\u0445 \u043a\u043e\u043b\u043e\u043d\u0438\u0437\u0430\u0442\u043e\u0440\u043e\u0432 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%B9%D0%B2%D0%B0%D0%BD%D1%8C\" title=\"\u0422\u0430\u0439\u0432\u0430\u043d\u044c\">\u0424\u043e\u0440\u043c\u043e\u0437\u044b<\/a> (\u0422\u0430\u0439\u0432\u0430\u043d\u044f).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1664\" class=\"mw-redirect\" title=\"1664\">1664<\/a>&#160;\u2014 \u0410\u0440\u043c\u0438\u044f \u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u0440\u043e\u043b\u044f \u0438 \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043a\u043d\u044f\u0437\u044f \u043b\u0438\u0442\u043e\u0432\u0441\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BD_II_%D0%9A%D0%B0%D0%B7%D0%B8%D0%BC%D0%B8%D1%80\" title=\"\u042f\u043d II \u041a\u0430\u0437\u0438\u043c\u0438\u0440\">\u042f\u043d\u0430 II \u041a\u0430\u0437\u0438\u043c\u0438\u0440\u0430<\/a> \u0431\u044b\u043b\u0430 \u043f\u0440\u0438\u043d\u0443\u0436\u0434\u0435\u043d\u0430 \u0441\u043d\u044f\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%B0%D0%B4%D0%B0_%D0%93%D0%BB%D1%83%D1%85%D0%BE%D0%B2%D0%B0\" title=\"\u041e\u0441\u0430\u0434\u0430 \u0413\u043b\u0443\u0445\u043e\u0432\u0430\">\u043e\u0441\u0430\u0434\u0443 \u0441 \u0413\u043b\u0443\u0445\u043e\u0432\u0430<\/a>. \u042d\u0442\u043e \u0441\u043e\u0431\u044b\u0442\u0438\u0435 \u0441\u0442\u0430\u043b\u043e \u043d\u0430\u0447\u0430\u043b\u043e\u043c \u0442\u044f\u0436\u0451\u043b\u043e\u0433\u043e \u043e\u0442\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u044f \u043f\u043e\u043b\u044c\u0441\u043a\u043e-\u043b\u0438\u0442\u043e\u0432\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0438. \u0411\u043e\u043b\u044c\u0448\u043e\u0439 \u043f\u043e\u0445\u043e\u0434 \u043a\u043e\u0440\u043e\u043b\u044f \u043f\u0440\u043e\u0432\u0430\u043b\u0438\u043b\u0441\u044f, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%87%D1%8C_%D0%9F%D0%BE%D1%81%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B0%D1%8F\" title=\"\u0420\u0435\u0447\u044c \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u0430\u044f\">\u0420\u0435\u0447\u044c \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u0430\u044f<\/a> \u043e\u043a\u043e\u043d\u0447\u0430\u0442\u0435\u043b\u044c\u043d\u043e \u043f\u043e\u0442\u0435\u0440\u044f\u043b\u0430 \u041b\u0435\u0432\u043e\u0431\u0435\u0440\u0435\u0436\u043d\u0443\u044e \u0423\u043a\u0440\u0430\u0438\u043d\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1699\" class=\"mw-redirect\" title=\"1699\">1699<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I\" title=\"\u041f\u0451\u0442\u0440 I\">\u041f\u0451\u0442\u0440 I<\/a> \u043f\u043e\u0432\u0435\u043b\u0435\u0432\u0430\u0435\u0442 \u0447\u0435\u043b\u043e\u0431\u0438\u0442\u043d\u044b\u0435 \u0438 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u044b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a> \u043f\u0438\u0441\u0430\u0442\u044c \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%B1%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B1%D1%83%D0%BC%D0%B0%D0%B3%D0%B0\" title=\"\u0413\u0435\u0440\u0431\u043e\u0432\u0430\u044f \u0431\u0443\u043c\u0430\u0433\u0430\">\u0433\u0435\u0440\u0431\u043e\u0432\u043e\u0439 \u0431\u0443\u043c\u0430\u0433\u0435<\/a>.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1702\" class=\"mw-redirect\" title=\"1702\">1702<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B7%D0%B0_%D0%B8%D1%81%D0%BF%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0437\u0430 \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u043e\u0435 \u043d\u0430\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u043e\">\u0412\u043e\u0439\u043d\u0430 \u0437\u0430 \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u043e\u0435 \u043d\u0430\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u043e<\/a>: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D0%B3%D0%B5%D0%BD%D0%B8%D0%B9_%D0%A1%D0%B0%D0%B2%D0%BE%D0%B9%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u0415\u0432\u0433\u0435\u043d\u0438\u0439 \u0421\u0430\u0432\u043e\u0439\u0441\u043a\u0438\u0439\">\u0415\u0432\u0433\u0435\u043d\u0438\u0439 \u0421\u0430\u0432\u043e\u0439\u0441\u043a\u0438\u0439<\/a> \u043f\u043e\u0431\u0435\u0434\u0438\u043b \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u043e\u0432 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BB%D1%8C%D1%80%D1%83%D0%B0,_%D0%A4%D1%80%D0%B0%D0%BD%D1%81%D1%83%D0%B0_%D0%B4%D0%B5_%D0%9D%D1%91%D0%B2%D0%B8%D0%BB%D1%8C\" title=\"\u0412\u0438\u043b\u044c\u0440\u0443\u0430, \u0424\u0440\u0430\u043d\u0441\u0443\u0430 \u0434\u0435 \u041d\u0451\u0432\u0438\u043b\u044c\">\u0433\u0435\u0440\u0446\u043e\u0433\u0430 \u0434\u0435 \u0412\u0438\u043b\u044c\u0440\u0443\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%91%D0%B8%D1%82%D0%B2%D0%B5_%D0%BF%D0%BE%D0%B4_%D0%9A%D1%80%D0%B5%D0%BC%D0%BE%D0%BD%D0%BE%D0%B9&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0411\u0438\u0442\u0432\u0435 \u043f\u043e\u0434 \u041a\u0440\u0435\u043c\u043e\u043d\u043e\u0439 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0431\u0438\u0442\u0432\u0435 \u043f\u043e\u0434 \u041a\u0440\u0435\u043c\u043e\u043d\u043e\u0439<\/a> .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1709\" class=\"mw-redirect\" title=\"1709\">1709<\/a>&#160;\u2014 \u041d\u0430 \u043d\u0435\u043e\u0431\u0438\u0442\u0430\u0435\u043c\u043e\u043c \u043e\u0441\u0442\u0440\u043e\u0432\u0435 \u0430\u0440\u0445\u0438\u043f\u0435\u043b\u0430\u0433\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0_%D0%A5%D1%83%D0%B0%D0%BD-%D0%A4%D0%B5%D1%80%D0%BD%D0%B0%D0%BD%D0%B4%D0%B5%D1%81\" class=\"mw-redirect\" title=\"\u041e\u0441\u0442\u0440\u043e\u0432\u0430 \u0425\u0443\u0430\u043d-\u0424\u0435\u0440\u043d\u0430\u043d\u0434\u0435\u0441\">\u0425\u0443\u0430\u043d \u0424\u0435\u0440\u043d\u0430\u043d\u0434\u0435\u0441<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%85%D0%B8%D0%B9_%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD\" title=\"\u0422\u0438\u0445\u0438\u0439 \u043e\u043a\u0435\u0430\u043d\">\u0422\u0438\u0445\u043e\u043c \u043e\u043a\u0435\u0430\u043d\u0435<\/a> \u043d\u0430\u0439\u0434\u0435\u043d \u0441\u0442\u0430\u0432\u0448\u0438\u0439 \u043f\u0440\u043e\u043e\u0431\u0440\u0430\u0437\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%B1%D0%B8%D0%BD%D0%B7%D0%BE%D0%BD_%D0%9A%D1%80%D1%83%D0%B7%D0%BE\" title=\"\u0420\u043e\u0431\u0438\u043d\u0437\u043e\u043d \u041a\u0440\u0443\u0437\u043e\">\u0420\u043e\u0431\u0438\u043d\u0437\u043e\u043d\u0430 \u041a\u0440\u0443\u0437\u043e<\/a> \u043c\u0430\u0442\u0440\u043e\u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BB%D1%8C%D0%BA%D0%B8%D1%80%D0%BA,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80\" title=\"\u0421\u0435\u043b\u044c\u043a\u0438\u0440\u043a, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0421\u0435\u043b\u043a\u0438\u0440\u043a<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1713\" class=\"mw-redirect\" title=\"1713\">1713<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u041e\u0441\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u041e\u0441\u043c\u0430\u043d\u0441\u043a\u0438\u0439<\/a> \u0441\u0443\u043b\u0442\u0430\u043d, \u043f\u043e\u0434 \u0434\u0430\u0432\u043b\u0435\u043d\u0438\u0435\u043c \u0420\u043e\u0441\u0441\u0438\u0438 \u0438 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0445 \u0434\u0435\u0440\u0436\u0430\u0432, \u0440\u0430\u0441\u043f\u043e\u0440\u044f\u0434\u0438\u043b\u0441\u044f \u0441\u0438\u043b\u043e\u0439 \u0432\u044b\u043f\u0440\u043e\u0432\u043e\u0434\u0438\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_XII\" title=\"\u041a\u0430\u0440\u043b XII\">\u041a\u0430\u0440\u043b\u0430 XII<\/a> \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BD%D0%B4%D0%B5%D1%80%D1%8B\" title=\"\u0411\u0435\u043d\u0434\u0435\u0440\u044b\">\u0411\u0435\u043d\u0434\u0435\u0440<\/a>, \u0432 \u0445\u043e\u0434\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/en.wikipedia.org\/wiki\/Skirmish_at_Bender\" class=\"extiw\" title=\"en:Skirmish at Bender\">\u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u043e\u0435 \u0441\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u0435 \u0448\u0432\u0435\u0434\u043e\u0432 \u0441 \u044f\u043d\u044b\u0447\u0430\u0440\u0430\u043c\u0438, \u0442.&#160;\u043d. \u00ab\u043a\u0430\u043b\u0430\u0431\u0430\u043b\u044b\u043a\u00bb<\/a> <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A1%D1%82%D1%8B%D1%87%D0%BA%D0%B0_%D1%83_%D0%91%D0%B5%D0%BD%D0%B4%D0%B5%D1%80&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0421\u0442\u044b\u0447\u043a\u0430 \u0443 \u0411\u0435\u043d\u0434\u0435\u0440 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0440\u0443\u0441\u0441\u043a.<\/a>, \u0430 \u0441\u0430\u043c \u041a\u0430\u0440\u043b \u0431\u044b\u043b \u0440\u0430\u043d\u0435\u043d.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1717\" class=\"mw-redirect\" title=\"1717\">1717<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u044b\u0439 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%BC%D0%BE%D0%B9_%D1%81%D0%B5%D0%B9%D0%BC\" title=\"\u041d\u0435\u043c\u043e\u0439 \u0441\u0435\u0439\u043c\">\u041d\u0435\u043c\u043e\u0439 \u0441\u0435\u0439\u043c<\/a>\u00bb. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B9%D0%BC_%D0%A0%D0%B5%D1%87%D0%B8_%D0%9F%D0%BE%D1%81%D0%BF%D0%BE%D