e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u0441\u0435\u043c\u044c\u0438 \u043d\u0430 \u043f\u043b\u043e\u0449\u0430\u0434\u0438 \u041b\u0438\u0441\u0441\u0430\u0431\u043e\u043da \u0442\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u0430\u043c\u0438-\u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0446\u0430\u043c\u0438, \u043d\u0435\u0434\u043e\u0432\u043e\u043b\u044c\u043d\u044b\u043c\u0438 \u043f\u043e\u043b\u0438\u0442\u0438\u043a\u043e\u0439 \u043a\u043e\u0440\u043e\u043b\u044f \u0438 \u043e\u0431\u0449\u0435\u0439 \u043e\u0431\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u043e\u0439 \u0432 \u0441\u0442\u0440\u0430\u043d\u0435. \u0412 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0438\u043d\u0446\u0438\u0434\u0435\u043d\u0442\u0430 \u043f\u043e\u0433\u0438\u0431\u043b\u0438 \u0441\u0430\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D1%8C\" title=\"\u041a\u043e\u0440\u043e\u043b\u044c\">\u043a\u043e\u0440\u043e\u043b\u044c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB%D1%83%D1%88_I\" title=\"\u041a\u0430\u0440\u043b\u0443\u0448 I\">\u041a\u0430\u0440\u043b\u0443\u0448 I<\/a> (1863\u20141908) \u0438 \u0435\u0433\u043e \u0441\u0442\u0430\u0440\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%8B%D0%BD\" title=\"\u0421\u044b\u043d\">\u0441\u044b\u043d<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%B8%D1%88_%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%B5,_%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3_%D0%91%D1%80%D0%B0%D0%B3%D0%B0%D0%BD%D1%81%D0%B0\" title=\"\u041b\u0443\u0438\u0448 \u0424\u0438\u043b\u0438\u043f\u0435, \u0433\u0435\u0440\u0446\u043e\u0433 \u0411\u0440\u0430\u0433\u0430\u043d\u0441\u0430\">\u0433\u0435\u0440\u0446\u043e\u0433 \u041b\u0443\u0438\u0448 \u0424\u0438\u043b\u0438\u043f\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/1887\" class=\"mw-redirect\" title=\"1887\">1887<\/a>\u2014<a href=\"https:\/\/ru.wikipedia.org\/wiki\/1908\" class=\"mw-redirect\" title=\"1908\">1908<\/a>). \u041d\u043e\u0432\u044b\u043c \u043a\u043e\u0440\u043e\u043b\u0451\u043c \u0431\u044b\u043b \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0451\u043d \u0441\u043f\u0430\u0441\u0451\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D1%83%D1%8D%D0%BB_II\" title=\"\u041c\u0430\u043d\u0443\u044d\u043b II\">\u041c\u0430\u043d\u0443\u044d\u043b II<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917\" class=\"mw-redirect\" title=\"1917\">1917<\/a>&#160;\u2014 \u0412\u0442\u043e\u0440\u0438\u0447\u043d\u043e\u0435 \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0435\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%BE%D0%B3%D1%80%D0%B0%D0%BD%D0%B8%D1%87%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%BF%D0%BE%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041d\u0435\u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u043d\u0430\u044f \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u043d\u0435\u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u043d\u043e\u0439 \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>, \u043f\u043e\u0441\u043b\u0443\u0436\u0438\u0432\u0448\u0435\u0435 \u0444\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u044b\u043c \u043f\u043e\u0432\u043e\u0434\u043e\u043c \u0432\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90_%D0%B2_%D0%9F%D0%B5%D1%80%D0%B2%D0%BE%D0%B9_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%BE%D0%B9_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B5\" title=\"\u0421\u0428\u0410 \u0432 \u041f\u0435\u0440\u0432\u043e\u0439 \u043c\u0438\