=\"mw-redirect\" title=\"\u041a\u0432\u0438\u0441\u043b\u0438\u043d\u0433\">\u041a\u0432\u0438\u0441\u043b\u0438\u043d\u0433\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D1%80%D0%B2%D0%B5%D0%B3%D0%B8%D1%8F\" title=\"\u041d\u043e\u0440\u0432\u0435\u0433\u0438\u044f\">\u041d\u043e\u0440\u0432\u0435\u0433\u0438\u0438<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1943\" class=\"mw-redirect\" title=\"1943\">1943<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BC%D0%BE%D0%B9%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u0417\u0430\u043c\u043e\u0439\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435\">\u0417\u0430\u043c\u043e\u0439\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435<\/a>: \u041e\u0442\u0440\u044f\u0434\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B5%D1%81%D1%82%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D0%B1%D0%B0%D1%82%D0%B0%D0%BB%D1%8C%D0%BE%D0%BD%D1%8B\" title=\"\u041a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u0438\u0435 \u0431\u0430\u0442\u0430\u043b\u044c\u043e\u043d\u044b\">\u0411\u0430\u0442\u0430\u043b\u044c\u043e\u043d\u043e\u0432 \u0445\u043b\u043e\u043f\u0441\u043a\u0438\u0445<\/a>\u00bb, \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e \u0441 \u043e\u0442\u0440\u044f\u0434\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%93%D0%B2%D0%B0%D1%80%D0%B4%D0%B8%D1%8F_%D0%BB%D1%8E%D0%B4%D0%BE%D0%B2%D0%B0&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0413\u0432\u0430\u0440\u0434\u0438\u044f \u043b\u044e\u0434\u043e\u0432\u0430 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0413\u0432\u0430\u0440\u0434\u0438\u0438 \u041b\u044e\u0434\u043e\u0432\u043e\u0439<\/a>, \u0440\u0430\u0437\u0431\u0438\u043b\u0438 \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0435 \u0447\u0430\u0441\u0442\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D0%BE%D0%B4_%D0%97%D0%B0%D0%B1%D0%BE%D1%80%D0%B5%D1%87%D0%BD%D0%BE\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u043e\u0434 \u0417\u0430\u0431\u043e\u0440\u0435\u0447\u043d\u043e\">\u0431\u0438\u0442\u0432\u0435 \u043f\u043e\u0434 \u0417\u0430\u0431\u043e\u0440\u0435\u0447\u043d\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944\" class=\"mw-redirect\" title=\"1944\">1944<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%85%D0%B8%D0%B9_%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD\" title=\"\u0422\u0438\u0445\u0438\u0439 \u043e\u043a\u0435\u0430\u043d\">\u0422\u0438\u0445\u043e\u043c \u043e\u043a\u0435\u0430\u043d\u0435<\/a> \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0432\u0441\u0442\u0443\u043f\u0430\u044e\u0442 \u0432 \u043e\u0436\u0435\u0441\u0442\u043e\u0447\u0451\u043d\u043d\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435 (\u0434\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/7_%D1%84%D0%B5%D0%B2%D1%80%D0%B0%D0%BB%D1%8F\" title=\"7 \u0444\u0435\u0432\u0440\u0430\u043b\u044f\">7 \u0444\u0435\u0432\u0440\u0430\u043b\u044f<\/a>), \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043e\u043d\u0438 \u043e\u0442\u043e\u0431\u044c\u044e\u0442 \u0443 \u044f\u043f\u043e\u043d\u0446\u0435\u0432 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9A%D0%B2%D0%B0%D0%B4%D0%B6%D0%B0%D0%BB%D0%B5%D0%B9%D0%BD_(%D0%B0%D1%82%D0%BE%D0%BB%D0%BB)&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041a\u0432\u0430\u0434\u0436\u0430\u043b\u0435\u0439\u043d (\u0430\u0442\u043e\u043b\u043b) (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041a\u0432\u0430\u0434\u0436\u0430\u043b\u0435\u0439\u043d<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D1%88%D0%B0%D0%BB%D0%BB%D0%BE%D0%B2%D1%8B_%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0\" title=\"\u041c\u0430\u0440\u0448\u0430\u043b\u043b\u043e\u0432\u044b \u041e\u0441\u0442\u0440\u043e\u0432\u0430\">\u041c\u0430\u0440\u0448\u0430\u043b\u043b\u043e\u0432\u044b \u041e\u0441\u0442\u0440\u043e\u0432\u0430<\/a>).&#160;\u2014 \u041e\u0441\u0432\u0430\u043b\u044c\u0434 \u042d\u0432\u0435\u0440\u0438 \u0441\u043e\u043e\u0431\u0449\u0430\u0435\u0442 \u043e\u0431 \u0443\u0447\u0430\u0441\u0442\u0438\u0438 \u0414\u041d\u041a \u0432 \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0435 \u043d\u0430\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u043f\u0440\u0438\u0437\u043d\u0430\u043a\u043e\u0432 \u0443 \u0432\u0438\u0440\u0443\u0441\u043e\u0432.&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D0%B0\" title=\"\u0412\u0430\u0440\u0448\u0430\u0432\u0430\">\u0412\u0430\u0440\u0448\u0430\u0432\u0435<\/a> \u043e\u0442\u0440\u044f\u0434\u043e\u043c \u00ab\u041f\u0435\u0433\u0430\u0441\u00bb&#160;\u2014 \u00ab\u0410\u0433\u0430\u0442\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%BC%D0%B8%D1%8F_%D0%BA%D1%80%D0%B0%D0%B9%D0%BE%D0%B2%D0%B0\" class=\"mw-redirect\" title=\"\u0410\u0440\u043c\u0438\u044f \u043a\u0440\u0430\u0439\u043e\u0432\u0430\">\u0410\u0440\u043c\u0438\u0438 \u043a\u0440\u0430\u0439\u043e\u0432\u043e\u0439<\/a>, \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9E%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%C2%AB%D0%9A%D1%83%D1%82%D1%87%D0%B5%D1%80%D0%B0%C2%BB&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u00ab\u041a\u0443\u0442\u0447\u0435\u0440\u0430\u00bb (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u00ab\u041a\u0443\u0442\u0447\u0435\u0440\u0430\u00bb<\/a>, \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0435\u043d \u0420\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c \u0421\u0421 \u0438 \u043f\u043e\u043b\u0438\u0446\u0438\u0438 \u0432 \u0412\u0430\u0440\u0448\u0430\u0432\u0435, \u0431\u0440\u0438\u0433\u0430\u0434\u0435\u043d\u0444\u044e\u0440\u0435\u0440 \u0421\u0421 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D1%82%D1%87%D0%B5%D1%80%D0%B0,_%D0%A4%D1%80%D0%B0%D0%BD%D1%86\" title=\"\u041a\u0443\u0442\u0447\u0435\u0440\u0430, \u0424\u0440\u0430\u043d\u0446\">\u0424\u0440\u0430\u043d\u0446 \u041a\u0443\u0442\u0447\u0435\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945\" class=\"mw-redirect\" title=\"1945\">1945<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0442\u043e\u0440\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BA%D0%B2%D0%B0%D0%B4%D0%BE%D1%80\" title=\"\u042d\u043a\u0432\u0430\u0434\u043e\u0440\">\u042d\u043a\u0432\u0430\u0434\u043e\u0440<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442 \u0432\u043e\u0439\u043d\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D1%82%D0%B8%D0%B9_%D0%A0%D0%B5%D0%B9%D1%85\" class=\"mw-redirect\" title=\"\u0422\u0440\u0435\u0442\u0438\u0439 \u0420\u0435\u0439\u0445\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a>.&#160;\u2014 \u0441\u043e\u0437\u0434\u0430\u043d \u041a\u0432\u0430\u0440\u0442\u0435\u0442 \u0438\u043c\u0435\u043d\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%9F%D0%BE%D1%80%D1%84%D0%B8%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0411\u043e\u0440\u043e\u0434\u0438\u043d, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041f\u043e\u0440\u0444\u0438\u0440\u044c\u0435\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u041f\u043e\u0440\u0444\u0438\u0440\u044c\u0435\u0432\u0438\u0447\u0430 \u0411\u043e\u0440\u043e\u0434\u0438\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946\" class=\"mw-redirect\" title=\"1946\">1946<\/a><ul><li>\u0418\u0437\u0431\u0440\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8,_%D0%A2%D1%80%D1%8E%D0%B3%D0%B2%D0%B5\" title=\"\u041b\u0438, \u0422\u0440\u044e\u0433\u0432\u0435\">\u0422\u0440\u044e\u0433\u0432\u0435 \u041b\u0438<\/a> \u043f\u0435\u0440\u0432\u044b\u043c \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u043c \u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u0451\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%9E%D0%B1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u041d\u0430\u0446\u0438\u0439\">\u041e\u041e\u041d<\/a>.<\/li><li>\u041f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B3%D1%80%D0%B8%D1%8F\" title=\"\u0412\u0435\u043d\u0433\u0440\u0438\u044f\">\u0412\u0435\u043d\u0433\u0440\u0438\u0438<\/a> \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0439.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1949\" class=\"mw-redirect\" title=\"1949\">1949<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u043e\u0442\u043c\u0435\u043d\u044f\u0435\u0442\u0441\u044f \u043d\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u0435 \u0440\u0430\u0441\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u0435 \u043e\u0434\u0435\u0436\u0434\u044b.<\/li><li>\u0424\u0438\u0440\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/RCA\" title=\"RCA\">RCA<\/a> \u0432\u044b\u043f\u0443\u0441\u043a\u0430\u0435\u0442 \u043f\u0435\u0440\u0432\u0443\u044e \u0432\u0438\u043d\u0438\u043b\u043e\u0432\u0443\u044e \u043f\u043b\u0430\u0441\u0442\u0438\u043d\u043a\u0443 \u043d\u0430 45 \u043e\u0431\/\u043c\u0438\u043d.<\/li><li>\u041d\u0430\u0447\u0430\u043b\u043e \u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u043a\u0438 \u043d\u043e\u0432\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BF%D0%BB%D0%B0%D0%BD_%D1%80%D0%B5%D0%BA%D0%BE%D0%BD%D1%81%D1%82%D1%80%D1%83%D0%BA%D1%86%D0%B8%D0%B8_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D1%8B\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u043f\u043b\u0430\u043d \u0440\u0435\u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438 \u041c\u043e\u0441\u043a\u0432\u044b\">\u0433\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u043b\u0430\u043d\u0430 \u0440\u0435\u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438 \u041c\u043e\u0441\u043a\u0432\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8C\" title=\"\u0418\u0437\u0440\u0430\u0438\u043b\u044c\">\u0418\u0437\u0440\u0430\u0438\u043b\u044c<\/a> \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%BD%D0%B5%D0%BA%D1%81%D0%B8%D1%8F\" title=\"\u0410\u043d\u043d\u0435\u043a\u0441\u0438\u044f\">\u0430\u043d\u043d\u0435\u043a\u0441\u0438\u0440\u0443\u0435\u0442<\/a> \u0417\u0430\u043f\u0430\u0434\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B5%D1%80%D1%83%D1%81%D0%B0%D0%BB%D0%B8%D0%BC\" title=\"\u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\">\u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1953\" class=\"mw-redirect\" title=\"1953\">1953<\/a>&#160;\u2014 50 \u043e\u0441\u043d\u043e\u0432\u043d\u044b\u0445 \u0434\u0430\u043c\u0431 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%8B\" title=\"\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u044b\">\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0438\u0438<\/a> \u0440\u0430\u0437\u043c\u044b\u0432\u0430\u044e\u0442\u0441\u044f \u0432\u043e\u043b\u043d\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%BE%D0%B5_%D0%BC%D0%BE%D1%80%D0%B5\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0435 \u043c\u043e\u0440\u0435\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0433\u043e \u043c\u043e\u0440\u044f<\/a>. \u0422\u043e\u043d\u0435\u0442 1835 \u0447\u0435\u043b\u043e\u0432\u0435\u043a, 72 \u0436\u0438\u0442\u0435\u043b\u044f \u044d\u0442\u0438\u0445 \u043c\u0435\u0441\u0442 \u044d\u0432\u0430\u043a\u0443\u0438\u0440\u043e\u0432\u0430\u043d\u044b, 43000 \u0441\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u0439 \u043f\u043e\u0434\u0432\u0435\u0440\u0433\u0430\u044e\u0442\u0441\u044f \u0440\u0430\u0437\u0440\u0443\u0448\u0435\u043d\u0438\u044e \u0438\u043b\u0438 \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0430\u044e\u0442\u04