%82%D0%BD%D0%B0%D0%BC\" title=\"\u042e\u0436\u043d\u044b\u0439 \u0412\u044c\u0435\u0442\u043d\u0430\u043c\">\u042e\u0436\u043d\u043e\u0433\u043e \u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B3%D1%83%D0%B5%D0%BD_%D0%9D%D0%B3%D0%BE%D0%BA_%D0%9B%D0%BE%D0%B0%D0%BD\" title=\"\u041d\u0433\u0443\u0435\u043d \u041d\u0433\u043e\u043a \u041b\u043e\u0430\u043d\">\u041d\u0433\u0443\u0435\u043d \u041d\u0433\u043e\u043a \u041b\u043e\u0430\u043d<\/a> \u0437\u0430\u0441\u0442\u0440\u0435\u043b\u0438\u043b \u043e\u0444\u0438\u0446\u0435\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%84%D1%80%D0%BE%D0%BD%D1%82_%D0%BE%D1%81%D0%B2%D0%BE%D0%B1%D0%BE%D0%B6%D0%B4%D0%B5%D0%BD%D0%B8%D1%8F_%D0%AE%D0%B6%D0%BD%D0%BE%D0%B3%D0%BE_%D0%92%D1%8C%D0%B5%D1%82%D0%BD%D0%B0%D0%BC%D0%B0\" title=\"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0444\u0440\u043e\u043d\u0442 \u043e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0435\u043d\u0438\u044f \u042e\u0436\u043d\u043e\u0433\u043e \u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0430\">\u0412\u044c\u0435\u0442\u043a\u043e\u043d\u0433\u0430<\/a> \u041d\u0433\u0443\u0435\u043d\u0430 \u0412\u0430\u043d \u041b\u0435\u043c\u0430. \u0421\u0434\u0435\u043b\u0430\u043d\u043d\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B4%D0%B0%D0%BC%D1%81,_%D0%AD%D0%B4%D0%B4%D0%B8\" title=\"\u0410\u0434\u0430\u043c\u0441, \u042d\u0434\u0434\u0438\">\u042d\u0434\u0434\u0438 \u0410\u0434\u0430\u043c\u0441\u043e\u043c<\/a> \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u044f \u0440\u0430\u0441\u0441\u0442\u0440\u0435\u043b\u0430 \u041d\u0433\u0443\u0435\u043d\u043e\u043c \u041d\u0433\u043e\u043a \u041b\u043e\u0430\u043d\u043e\u043c \u043f\u0430\u0440\u0442\u0438\u0437\u0430\u043d\u0430 \u0441\u0442\u0430\u043b\u0430 \u043e\u0434\u043d\u043e\u0439 \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u044b\u0445 \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%8C%D0%B5%D1%82%D0%BD%D0%B0%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" class=\"mw-redirect\" title=\"\u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u0438 \u0441\u0438\u043c\u0432\u043e\u043b\u043e\u043c \u0436\u0435\u0441\u0442\u043e\u043a\u043e\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>. \u0424\u0430\u043a\u0442 \u0440\u0430\u0441\u0441\u0442\u0440\u0435\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE%D0%BF%D0%BB%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9\" class=\"mw-redirect\" title=\"\u0412\u043e\u0435\u043d\u043d\u043e\u043f\u043b\u0435\u043d\u043d\u044b\u0439\">\u0432\u043e\u0435\u043d\u043d\u043e\u043f\u043b\u0435\u043d\u043d\u043e\u0433\u043e<\/a> \u0431\u0435\u0437 \u0441\u0443\u0434\u0430 \u0438 \u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u044f, \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u043d\u043e\u0433\u043e \u043a \u0442\u043e\u043c\u0443 \u0436\u0435 \u043d\u0430\u0447\u0430\u043b\u044c\u043d\u0438\u043a\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D0%B8%D1%86%D0%B8%D1%8F\" title=\"\u041f\u043e\u043b\u0438\u0446\u0438\u044f\">\u043f\u043e\u043b\u0438\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B6%D0%BD%D1%8B%D0%B9_%D0%92%D1%8C%D0%B5%D1%82%D0%BD%D0%B0%D0%BC\" title=\"\u042e\u0436\u043d\u044b\u0439 \u0412\u044c\u0435\u0442\u043d\u0430\u043c\">\u042e\u0436\u043d\u043e\u0433\u043e \u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0430<\/a>, \u0432\u044b\u0437\u0432\u0430\u043b \u0432\u043e\u043b\u043d\u0443 \u043d\u0435\u0433\u043e\u0434\u043e\u0432\u0430\u043d\u0438\u044f \u0432 \u043a\u0440\u0443\u0433\u0430\u0445 \u0438\u043d\u0442\u0435\u043b\u043b\u0438\u0433\u0435\u043d\u0446\u0438\u0438, \u0430 \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u044f \u0448\u0438\u0440\u043e\u043a\u043e \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b\u0430\u0441\u044c \u0430\u043d\u0442\u0438\u0432\u043e\u0435\u043d\u043d\u044b\u043c \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0435\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1969\" class=\"mw-redirect\" title=\"1969\">1969<\/a><ul><li>\u0420\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B3%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D1%8F\" title=\"\u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u044f\">\u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%BC%D1%8B%D0%BD%D0%B8%D1%8F\" title=\"\u0420\u0443\u043c\u044b\u043d\u0438\u044f\">\u0420\u0443\u043c\u044b\u043d\u0438\u0438<\/a> \u0432 \u0441\u043e\u0432\u043c\u0435\u0441\u0442\u043d\u043e\u043c \u0437\u0430\u044f\u0432\u043b\u0435\u043d\u0438\u0438 \u043e\u0442\u0432\u0435\u0440\u0433\u0430\u044e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BA%D1%82%D1%80%D0%B8%D0%BD%D0%B0_%D0%91%D1%80%D0%B5%D0%B6%D0%BD%D0%B5%D0%B2%D0%B0\" title=\"\u0414\u043e\u043a\u0442\u0440\u0438\u043d\u0430 \u0411\u0440\u0435\u0436\u043d\u0435\u0432\u0430\">\u0434\u043e\u043a\u0442\u0440\u0438\u043d\u0443 \u0411\u0440\u0435\u0436\u043d\u0435\u0432\u0430<\/a> \u043e \u043f\u0440\u0438\u043e\u0440\u0438\u0442\u0435\u0442\u0435 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u