et Journal\">The Wall Street Journal<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%BB,_%D0%94%D1%8D%D0%BD%D0%B8%D0%B5%D0%BB\" title=\"\u041f\u0435\u0440\u043b, \u0414\u044d\u043d\u0438\u0435\u043b\">\u0414\u044d\u043d\u0438\u0435\u043b \u041f\u0435\u0440\u043b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2003\" class=\"mw-redirect\" title=\"2003\">2003<\/a>&#160;\u2014 \u041f\u0440\u0438 \u0437\u0430\u0445\u043e\u0434\u0435 \u043d\u0430 \u043f\u043e\u0441\u0430\u0434\u043a\u0443 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%81%D0%BC%D0%BE%D0%B4%D1%80%D0%BE%D0%BC\" title=\"\u041a\u043e\u0441\u043c\u043e\u0434\u0440\u043e\u043c\">\u043a\u043e\u0441\u043c\u043e\u0434\u0440\u043e\u043c<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8B%D1%81\" title=\"\u041c\u044b\u0441\">\u043c\u044b\u0441\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B2%D0%B5%D1%80%D0%B0%D0%BB\" title=\"\u041a\u0430\u043d\u0430\u0432\u0435\u0440\u0430\u043b\">\u041a\u0430\u043d\u0430\u0432\u0435\u0440\u0430\u043b<\/a> (\u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%BE%D1%80%D0%B8%D0%B4%D0%B0\" title=\"\u0424\u043b\u043e\u0440\u0438\u0434\u0430\">\u0424\u043b\u043e\u0440\u0438\u0434\u0430<\/a>) \u0432\u0437\u043e\u0440\u0432\u0430\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B8%D1%8F_(%D1%88%D0%B0%D1%82%D1%82%D0%BB)\" title=\"\u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f (\u0448\u0430\u0442\u0442\u043b)\">\u0448\u0430\u0442\u0442\u043b \u00ab\u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f\u00bb<\/a>, \u043f\u043e\u0433\u0438\u0431\u043b\u0438 \u0432\u0441\u0435 \u0441\u0435\u043c\u044c \u0